import "./App.css";
import React from "react";

import Grid from "./components/Grid";

import axios from "axios";

class App extends React.Component {
  componentDidMount() {
    console.log(this.renderContent());
  }
  async renderContent() {
    const content = await axios.get("https://pokeapi.co/api/v2/pokemon").data
      .results;
    return content;
  }

  render() {
    const x = [{ name: "e" }];
    return (
      <div className="App">
        <h1>HTTPS requests</h1>
        <h2>Async await</h2>
        <h2>Promises</h2>
        <h1>Pokemon's index</h1>
        <Grid content={x} />
      </div>
    );
  }
}

export default App;
